import { Container, Row, Col } from "react-bootstrap";

const App = () => {
  return (
    <Container>
      <Row fluid={true}>
        <Col md={3}>a side</Col>
        <Col md={9}>b side</Col>
      </Row>
    </Container>
  );
};
export default App;
